import React from 'react';
import logo from './images/Podnet1.png';
import './Sidebar.css';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button'
import './Sidebar.css'
import facebook from './images/facebook'

class SidebarContents extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: 'Tony Stark',
            password: 'IamIronMan'
        };

        this.handleChange = this.handleChange.bind(this);
    }

    handleChange(event) {
        this.setState({ value: event.target.value });
    }

    render() {
        return (
            <div className="container">
                <div classname="row">
                    <img src={logo} alt="logo" class="logo-opacity" activeStyle={{opacity:'1'}} />
                </div>
                <div classname="row">
                    <Form>
                        <Form.Group controlId="formBasicEmail">
                            <Form.Label style={{color:'white'}}>Email address:</Form.Label>
                            <Form.Control type="email" placeholder="Enter email, e.g. TonyStark@gmail.com" />
                            <Form.Text className="text-muted" style={{color:'white'}}>
                                We'll share your email with everyone else if you believe Tony Stark will use Gmail, otherwise you're safe with us.
    </Form.Text>
                        </Form.Group>

                        <Form.Group controlId="formBasicPassword">
                            <Form.Label style={{color:'white'}} >Password</Form.Label>
                            <Form.Control type="password" placeholder="Password, e.g. IamIronMan" />
                        </Form.Group> 
                        <Button variant="primary" type="submit" style={{margin:'20px'}}>
                            Submit
  </Button>
                    </Form>
                </div>
                <div classname="row">
                    <div classname="col-md"> <img src={facebook} alt="facebook"/> </div>
                    <div classname="col-md"> </div>
                    <div classname="col-md"> </div>
                </div>
            </div>
        )
    }
}

export default SidebarContents;
